import React, { useState } from 'react'

const Vcard = () => {
    const [items,setItems] =useState[
        {
        id:1,
        image: 'Icons_1',
        num:'$99,125.00',
        text:'Todays Revenue'
        },
        {
        id:2,
        image:'Icons_2',
        num:'365',
        text:'Transactions'
        }]
  return (
    <div>Vcard</div>
  )
}

export default Vcard
